La diffusione di notizie false, in particolare sui social media, è un fenomeno in continua crescita, che può avere conseguenze molto gravi.
Le fake news possono essere di vario genere:
– false informazioni che riguardano la salute e la sicurezza, come le notizie su presunte epidemie di malattie o di virus, o sulle conseguenze di una determinata dieta o stile di vita;
– notizie che riguardano l'attualità, come la cronaca nera, la politica o la cronaca sportiva, o notizie che riguardano la scienza, la tecnologia, l'economia, la medicina, la politica, l'arte, la cultura e la religione;
– notizie che riguardano la cultura, la società, la politica, la religione, l'attualità e la scienza;
– notizie false che riguardano le celebrità, i personaggi pubblici e le celebrità.
